   "wallet.login.hello.text": "\u0532\u0561\u0580\u056B \u0563\u0561\u056C\u0578\u0582\u057D\u057F \u0541\u0565\u0580 ConnectToWallet. \u0531\u0575\u057D \u0567\u057B\u056B \u0585\u0563\u0576\u0578\u0582\u0569\u0575\u0561\u0574\u0562 \u0534\u0578\u0582\u0584 \u056F\u0561\u0580\u0578\u0572 \u0565\u0584 \u0578\u0582\u0572\u0561\u0580\u056F\u0565\u056C, \u056B\u0576\u0579\u057A\u0565\u057D \u0576\u0561\u0587 \u056D\u0576\u0564\u0580\u0565\u056C \u0587 \u057D\u057F\u0561\u0576\u0561\u056C \u0563\u0578\u0582\u0574\u0561\u0580\u0576\u0565\u0580 ConnectToWallet-\u056B \u0561\u0575\u056C \u0585\u0563\u057F\u0561\u057F\u0565\u0580\u0565\u0580\u056B\u0581: \u0531\u0575\u057D \u0563\u0578\u0580\u056E\u0561\u0580\u0584\u0576\u0565\u0580\u056B \u056A\u0561\u0574\u0561\u0576\u0561\u056F \u0578\u0580\u0578\u0577\u0561\u056F\u056B \u057F\u0578\u056F\u0578\u057D\u0576\u0565\u0580 \u0565\u0576 \u057A\u0561\u0570\u057E\u0578\u0582\u0574 \u0561\u0575\u0576 \u0563\u0578\u0582\u0574\u0561\u0580\u0576\u0565\u0580\u056B\u0581, \u0578\u0580\u0578\u0576\u0581 \u0534\u0578\u0582\u0584 \u0561\u057C\u0576\u0579\u057E\u0578\u0582\u0574 \u0565\u0584(\u0534\u0578\u0582\u0584 \u056F\u0561\u0580\u0578\u0572 \u0565\u0584 \u0561\u057E\u0565\u056C\u056B \u0574\u0561\u0576\u0580\u0561\u0574\u0561\u057D\u0576 \u057F\u0565\u0572\u0565\u056F\u0578\u0582\u0569\u0575\u0578\u0582\u0576 \u057D\u057F\u0561\u0576\u0561\u056C \u0561\u057C\u0561\u057E\u0565\u056C\u0561\u0563\u0578\u0582\u0575\u0576 \u0587 \u0576\u057E\u0561\u0566\u0561\u0563\u0578\u0582\u0575\u0576 \u057F\u0578\u056F\u0578\u057D\u0576\u0565\u0580\u056B\u0581 \u054A\u0561\u0575\u0574\u0561\u0576\u0576\u0565\u0580 \u0587 \u0540\u0561\u0576\u0563\u0561\u0574\u0561\u0576\u0584\u0576\u0565\u0580 \u0562\u0561\u056A\u0576\u0578\u0582\u0574): \u0535\u0569\u0565 \u056B\u0576\u0579-\u0578\u0580 \u0561\u0576\u0571 \u0561\u0576\u0570\u0561\u0576\u0563\u057D\u057F\u0561\u0581\u0576\u0578\u0582\u0574 \u0567 \u0541\u0565\u0566, \u0561\u057A\u0561 \u056F\u0561\u0580\u0578\u0572 \u0565\u0584 \u0576\u0580\u0561\u0576 \u0561\u057E\u0565\u056C\u0561\u0581\u0576\u0565\u056C \u0541\u0565\u0580 \u0531\u0580\u0563\u0565\u056C\u0561\u0583\u0561\u056F\u057E\u0561\u056E \u0585\u0563\u057F\u0561\u057F\u0565\u0580\u0565\u0580\u056B \u0581\u0578\u0582\u0581\u0561\u056F\u0578\u0582\u0574: \u0535\u0569\u0565 \u0574\u0565\u056E \u0574\u0561\u057D\u0561\u0574\u0562 \u0563\u0578\u0580\u056E \u0565\u0584 \u0578\u0582\u0576\u0565\u0576\u0578\u0582\u0574 \u0574\u0565\u056F \u0561\u0580\u056A\u0578\u0582\u0575\u0569\u056B \u0570\u0565\u057F, \u0561\u057A\u0561 \u056D\u0578\u0580\u0570\u0578\u0582\u0580\u0564 \u0565\u0576\u0584 \u057F\u0561\u056C\u056B\u057D \u0561\u0575\u0576 \u0564\u0561\u0580\u0571\u0576\u0565\u056C \u0541\u0565\u0580 \u0568\u0576\u0569\u0561\u0581\u056B\u056F \u0561\u0580\u056A\u0578\u0582\u0575\u0569\u0568 \u0538\u0576\u0569\u0561\u0581\u056B\u056F \u0561\u0580\u056A\u0578\u0582\u0575\u0569 \u0562\u0561\u056A\u0576\u0578\u0582\u0574, \u0584\u0561\u0576\u056B \u0578\u0580 \u0561\u0575\u057D\u057A\u056B\u057D\u0578\u057E \u0534\u0578\u0582\u0584 \u0561\u057E\u0565\u056C\u056B \u0584\u056B\u0579 \u0563\u0578\u0582\u0574\u0561\u0580 \u056F\u056E\u0561\u056D\u057D\u0565\u0584:  \u0534\u0578\u0582\u0584 \u0576\u0561\u0587 \u056F\u0561\u0580\u0578\u0572 \u0565\u0584 \u0561\u0579\u0584\u056B \u0561\u0576\u0581\u056F\u0561\u0581\u0576\u0565\u056C \u0541\u0565\u0580 \u0568\u0576\u0569\u0561\u0581\u056B\u056F \u0587 \u0561\u0580\u0564\u0565\u0576 \u056B\u057D\u056F \u0561\u057E\u0561\u0580\u057F\u0561\u056E \u0563\u0578\u0580\u056E\u0561\u0580\u0584\u0576\u0565\u0580\u0568, \u056B\u0576\u0579\u0568 \u0541\u0565\u0566 \u0570\u0561\u0574\u0561\u0580 \u0561\u057E\u0565\u056C\u056B \u0570\u0565\u0577\u057F \u0587 \u0570\u0561\u0580\u0574\u0561\u0580\u0561\u057E\u0565\u057F \u056F\u0564\u0561\u057C\u0576\u0561 \u0574\u0565\u0580 \u0562\u0561\u0566\u0574\u0561\u0569\u056B\u057E \u0586\u056B\u056C\u057F\u0580\u0565\u0580\u056B \u0574\u056B\u057B\u0578\u0581\u0578\u057E: \u0534\u0578\u0582\u0584 \u0576\u0561\u0587 \u056F\u0561\u0580\u0578\u0572 \u0565\u0584 \u0563\u0578\u0580\u056E\u0561\u0580\u0584\u0576\u0565\u0580 \u0578\u0582\u0576\u0565\u0576\u0561\u056C \u0541\u0565\u0580 \u057E\u0561\u0580\u056F\u0561\u0575\u056B\u0576 \u0584\u0561\u0580\u057F\u0565\u0580\u0578\u057E\u055D \u0568\u0576\u057F\u0580\u0565\u056C\u0578\u057E \u054E\u0561\u0580\u056F\u0561\u0575\u056B\u0576 \u0584\u0561\u0580\u057F\u0578\u057E \u0563\u0578\u0580\u056E\u0561\u0580\u0584\u0576\u0565\u0580 \u0562\u0561\u056A\u056B\u0576\u0568 \u0587 \u0570\u0565\u057F\u0587\u0565\u056C\u0578\u057E \u0581\u0578\u0582\u0581\u0578\u0582\u0574\u0576\u0565\u0580\u056B\u0576: ConnectToWallet-\u0568 \u0561\u057B\u0561\u056F\u0581\u0578\u0582\u0574 \u0567 \u0579\u0578\u0580\u057D \u057E\u0561\u0580\u056F\u0561\u0575\u056B\u0576 \u0584\u0561\u0580\u057F\u0565\u0580\u056B\u055D MasterCard, Visa, American Express, Discover: \u0534\u0578\u0582\u0584 \u0576\u0561\u0587 \u056F\u0561\u0580\u0578\u0572 \u0565\u0584 \u0568\u057D\u057F \u0570\u0565\u0580\u0569\u0561\u056F\u0561\u0576\u0578\u0582\u0569\u0575\u0561\u0576 \u0564\u0561\u057D\u0561\u057E\u0578\u0580\u0565\u056C \u0541\u0565\u0580 \u057E\u0561\u0580\u056F\u0561\u0575\u056B\u0576 \u0584\u0561\u0580\u057F\u0565\u0580\u0568\u055D \u0565\u056C\u0576\u0565\u056C\u0578\u057E \u0585\u0563\u057F\u0561\u0563\u0578\u0580\u056E\u0574\u0561\u0576 \u0570\u0561\u0573\u0561\u056D\u0561\u056F\u0561\u0576\u0578\u0582\u0569\u0575\u0578\u0582\u0576\u056B\u0581:",  // Used in: 
