   "pages.login.partner.company.request.form.second.text": "\u0535\u0580\u0562 \u0541\u0565\u0580 \u056F\u0561\u0566\u0574\u0561\u056F\u0565\u0580\u057A\u0578\u0582\u0569\u0575\u0578\u0582\u0576\u0568 \u057D\u057F\u0565\u0572\u056E\u057E\u056B, \u0534\u0578\u0582\u0584 \u057A\u0565\u057F\u0584 \u0567 \u0563\u0580\u0561\u0576\u0581\u057E\u0565\u0584:\u053F\u0561\u0580\u0573 \u056A\u0561\u0574\u0561\u0576\u0561\u056F\u056B \u0568\u0576\u0569\u0561\u0581\u0584\u0578\u0582\u0574  VShoo-\u056B \u0572\u0565\u056F\u0561\u057E\u0561\u0580\u0578\u0582\u0569\u0575\u0578\u0582\u0576\u0568 \u056F\u057E\u0565\u0580\u0561\u0576\u0561\u0575\u056B \u0541\u0565\u0580 \u0576\u0578\u0580 \u0563\u0580\u0561\u0576\u0581\u0578\u0582\u0574\u0568 \u0587 \u0534\u0578\u0582\u0584 \u056F\u056F\u0561\u0580\u0578\u0572\u0561\u0576\u0561\u0584 \u0574\u0578\u0582\u057F\u0584 \u0563\u0578\u0580\u056E\u0565\u056C:",  // Used in: 
