   "pages.hollor.main.interactivtv": "<div class=\"row\"><div class=\"col-lg-12 col-md-12 col-sm-12\"><h2 class=\"text-center\">\u053B\u0576\u057F\u0565\u0580\u0561\u056F\u057F\u056B\u057E \u0570\u0565\u057C\u0578\u0582\u057D\u057F\u0561\u057F\u0565\u057D\u0578\u0582\u0569\u0575\u0578\u0582\u0576</h2></div></div><div class=\"row\"><span class=\"col-lg-6 col-lg-offset-3 col-md-12 col-md-offset-0 col-sm-10 col-sm-offset-1 col-xs-10 col-xs-offset-1\"><p>\u0546\u0561\u0575\u056B\u055B\u0580 \u0570\u0565\u057C\u0578\u0582\u057D\u057F\u0561\u0581\u0578\u0582\u0575\u0581 \u0587 \u0570\u0561\u0572\u0578\u0580\u0564\u0561\u056F\u0581\u057E\u056B\u055B\u0580 \u0568\u0576\u056F\u0565\u0580\u0576\u0565\u0580\u056B\u0564 \u0570\u0565\u057F \u0574\u056B\u0561\u056A\u0561\u0574\u0561\u0576\u0561\u056F</p><p>-\u0544\u0578\u0582\u055B\u057F\u0584 \u0563\u0578\u0580\u056E\u056B\u0580 \u0570\u0565\u057C\u0578\u0582\u057D\u057F\u0561\u057F\u0565\u057D\u0561\u0575\u056B\u0576 \u0561\u056C\u056B\u0584\u0576\u0565\u0580 \u0587 \u057F\u0565\u057D\u0561\u0576\u0575\u0578\u0582\u0569\u0565\u0580\u055D\u0578\u0582\u0572\u056B\u0572 \u0565\u0569\u0565\u0580\u0578\u057E, \u0581\u0561\u0576\u056F\u0561\u0581\u0561\u056E \u057E\u0561\u0575\u0580\u0578\u0582\u0574 \u0581\u0561\u0576\u056F\u0561\u0581\u0561\u056E \u057D\u0561\u0580\u0584\u056B\u0581 (\u0570\u0565\u057C\u0578\u0582\u057D\u057F\u0561\u0581\u0578\u0582\u0575\u0581, \u0570\u0565\u057C\u0561\u056D\u0578\u057D, \u0570\u0561\u0574\u0561\u056F\u0561\u0580\u0563\u056B\u0579)</p><p>- \u054D\u057F\u0565\u0572\u056E\u056B\u055B\u0580 \u0584\u0578 \u057F\u0565\u057D\u0561\u0576\u0575\u0578\u0582\u0569\u0568 \u0578\u0582\u0572\u056B\u0572 \u0565\u0569\u0565\u0580\u0578\u057E \u0587 \u0564\u0561\u0580\u0571\u0580\u0578\u0582\u055B \u0561\u0575\u0576 \u0570\u0561\u057D\u0561\u0576\u0565\u056C\u056B \u0561\u0575\u056C \u0564\u056B\u057F\u0578\u0580\u0564\u0576\u0565\u0580\u056B \u0570\u0561\u0574\u0561\u0580</p></span></div>",  // Used in: 
   "pages.hollor.main.comunicate": "<div class=\"row\"><div class=\"col-lg-8 col-md-10 col-sm-10\"><h2 class=\"text-center\">Communicate</h2></div></div><div class=\"row\"><span class=\"col-lg-6 col-lg-offset-1 col-md-8 col-md-offset-1 col-sm-10 col-sm-offset-1 col-xs-10 col-xs-offset-1 \"><s:set var=\"com\" value=\"\"/><p>\u053F\u056B\u057D\u056B\u055B\u0580 \u0584\u0578 \u0574\u057F\u0584\u0565\u0580\u0576 \u0578\u0582 \u0570\u0578\u0582\u0577\u0565\u0580\u0568, \u0576\u056F\u0561\u0580\u0576\u0565\u0580\u0576 \u0578\u0582 \u057F\u0565\u057D\u0561\u0576\u0575\u0578\u0582\u0569\u0565\u0580\u0568, \u0584\u0576\u0576\u0561\u0580\u056F\u0578\u0582\u0574\u0576\u0565\u0580\u0576 \u0578\u0582 \u057F\u0565\u057D\u0561\u056A\u0578\u0572\u0578\u057E\u0576\u0565\u0580\u0568:</p><p> - \u053F\u0561\u057F\u0561\u0580\u056B\u055B\u0580 \u0587 \u057D\u057F\u0561\u0581\u056B\u055B\u0580 \u0566\u0561\u0576\u0563\u0565\u0580 \u0581\u0561\u0576\u056F\u0561\u0581\u0561\u056E \u0570\u0565\u057C\u0561\u056D\u0578\u057D\u056B\u0581</p><p> - \u054D\u057F\u0565\u0572\u056E\u056B\u055B\u0580 \u0570\u0561\u057D\u0561\u0580\u0561\u056F\u0561\u056F\u0561\u0576, \u0574\u0561\u057D\u0576\u0561\u057E\u0578\u0580, \u056F\u0578\u0580\u057A\u0578\u0580\u0561\u057F\u056B\u057E \u056D\u0574\u0562\u0565\u0580 \u0587 \u0570\u0561\u0574\u0561\u0563\u0578\u0580\u056E\u0561\u056F\u0581\u056B\u055B\u0580 \u0581\u0561\u0576\u056F\u0561\u0581\u0561\u056E \u0576\u0561\u056D\u0561\u0563\u056E\u0578\u0582\u0574</p></span></div>",  // Used in: 
